é um privilégio ver daqui




























Aladdin









Um humilde jovem descobre uma lâmpada mágica, com um gênio que pode lhe conceder desejos. Agora o rapaz quer conquistar a moça por quem...

Dirigido por: Guy Ritchie
Elenco: Will Smith, Mena Massoud, Naomi Scott































































Brightburn - Filho das trevas









Quando uma criança alienígena cai no terreno de um casal da parte rural dos Estados Unidos, eles decidem criar o menino como seu filho. Porém...

Dirigido por: David Yarovesky
Elenco: Elizabeth Banks, David Denman, Meredit Hagner















































Tolkien









“Tolkien” explora os anos de formação do autor órfão ao encontrar amizade, amor e inspiração artística entre um grupo de colegas excluídos...

Dirigido por: Dome Karukoski
Elenco: Nicholas Hoult, Lily Collins, Patrick Gibson, Anthony Boyle





































































































































































































































































